INSERT INTO `accounts_donationfund` VALUES (1,'Trahi Foundation','<p>Trahi Foundation is an organization formed by the 1993 batch NITW alumni and is based in Bangalore.</p>\r\n'),(2,'NITW Americas Alumni Chapter','<p>The NITW Americas Alumni Chapter is a tax exempt organization under IRS Code Section 501 (c)(3) set up by the NITW alumni in the United States in 1999.</p>'),(3,'NITW Alumni Middle East Chapter','<p>The NITW Alumni Middle East Chapter connects alumni from Western Asia and parts of North Africa.</p>'),(4,'Tom Zacharia Foundation','<p>Tom Zacharia foundation was established on 17 December 2010 by Tom\'s family. The key objective of the foundation is to keep the memory of Tom alive by supporting the values he held close to his heart - brilliance in your work, giving back to society, forging friendships across race and religion, and loving with a fire.<br/>\r\nThe foundation aspires to achieve the following:<br/>\r\n<ul>\r\n<li>Support those who wish to pursue a professional career in science or engineering but do not have the means to do so.</li>\r\n<li>Provide financial support and or scholarships to deserving children.</li>\r\n<li>Provide support to other foundations / institutions that propagate and/or stand for above described causes.</li></ul>\r\nThe foundation is primarily funded by the family. Secondary funding comes from royalties of the book \"Live Like Tom\" being published by Bency and Zac Thomas.</p>'),(5,'BVS Murthy 1979-83 NITW Alumni Scholarship','<p>The NITW Class of 1979-83 established this scholarship in memory of their deceased batchmate, Mr.B.V.S.Murty.</p>'),(6,'K Srikant Murty 1979-83 NITW Alumni Scholarship','<p>The NITW Class of 1979-83 established this scholarship in memory of their deceased batchmate, Mr.K. Srikant Murty.</p>'),(7,'Jyothirmoy Das 1979-83 NITW Alumni Scholarship','<p>The NITW Class of 1979-83 established this scholarship in memory of their deceased batchmate, Mr. Jyothirmoy Das.</p>'),(8,'Mr. Narayan','<p>Mr.Narayan is from the NITW Class of 1983 and graduated with a undergraduate degree in Electronics and Communication Engineering.</p>'),(9,'Mr. Prabhakar Puvvada','<p>Mr. Prabhakar Puvvada is from the NITW Class of 1980 and graduated with a undergraduate degree in Electrical and Electronics Engineering.</p>'),(11,'Lakshya Foundation','Lakshya also funds students directly from its funds which come in from various donors.'),(12,'Manish Anand Fund','Manish Anand Memorial Scholarship was established by the B.Tech Class of 2008 batch in the memory of their beloved friend and batchmate Manish Anand Siddini (B.Tech, Chemical Engineering) to support students who display academic excellence and need financial assistance.'),(13,'Naveen Ashok Scholarship','The Naveen Ashok Scholarship has been instituted in the memory of Naveen Ashok by his father, Ashok Ramakrishna, mother and his grandparents. This will be a grant which will go towards covering part of the tuition fee of the top performing Lakshya scholar every year. \r\n\r\nLakshya scholars are selected primarily based on their financial need and are given an interest free loan to cover for their tuition and hostel fees. This grant will also serve as an incentive for all financially weak students to perform.\r\n'),(14,'Lakshya corpus','Corpus fund');
/*!40000 ALTER TABLE `accounts_donationfund` ENABLE KEYS */;
