INSERT INTO `entrepreneurship_company` VALUES (3,'Trans Autoparts Co. Ltd','trans-autoparts','Trans Autoparts Co. Ltd is a private limited company registered in 1987. It started operating as a service industry in the Automotive Engine Rebuilding in May 1992 at a very small place at Mshihiri Street under the able chief executive Eng.Shabbir H. Khataw. \r\n\r\nThe company moved to a bigger location on Plot 74 Nkrumah Street in February 1996 to cater for the expansion needs of the market. ','http://www.tapco.co.tz/','http://www.youtube.com/embed/JPhBXCVu76M','company/logo/logo.png','GEREZANI','DAR ES SALAAM','21338','TANZANIA','+255 653 765682, ','',NULL,7,0),(4,'ArrayShield Technologies','array-shield-technologies','ArrayShield Technologies is provider of innovative Pattern based Two Factor Authentication Solutions. ArrayShield is recognized as one of the Top 100 fastest growing companies in Asia by RedHerring in 2011, winner of Nasscom Emerge 50 Honor in 2012, selected as finalist for the DSCI Excellence Award 2012 for Emerging Information Security Product Company. ArrayShields patent protected two factor authentication technology has won multiple awards and recognitions at global level for its pioneering innovation. ArrayShield is a member of NASSCOM, the apex body of the Indian Software Industry.','http://www.arrayshield.com/','http://www.youtube.com/embed/bvVWtcTW2VA','company/logo/logo_07.jpg','Chennai','Tamil Nadu','600044','India','+91-044-43868276','',NULL,7,0),(6,'Abhyaas','abhyaas','Abhyaas as the name suggests, is a platform that promotes a reformed age-old learning principle that stresses on \'to apply oneself\'. It is a new age EduCorp on an endearing mission to redefine the way teaching and learning happens in India. It is formed with a vision to bring a positive change in the way education is sought after and perceived.','http://www.abhyaas.in/','','company/logo/homepage-logo.png','Secunderabad','Andhra Pradesh','','India','04065243239','',NULL,7,0),(7,'Scrapehere','scrapehere','Scrapehere is an online Window-Shopping website that allows users to create collections of the products they like while shopping on e-commerce websites. It provides a social window shopping experience by allowing customers to share their collection with friends who can provide valid feedback/review/rate your products.','http://www.scrapehere.com/home.html','http://www.youtube.com/watch?feature=player_embedded&v=vrbqV7v_0HE','company/logo/scrapehere_logo.png','Bangalore','Karnataka','','India','','contactus@scrapehere.com',NULL,7,0),(8,'21 Fashion Street','21fashionstreet','21FashionStreet offers a breathtaking display of high fashion accessories from around the world for the modern woman.\r\n\r\nElegant, glamorous, simple, bling, loud - no matter what your style is, you will find accessories to match your style!\r\n\r\nOur variety of accessories include earrings, neck pieces, rings, scarves, bracelets, brooches and much more.','http://www.21fashionstreet.com/','','company/logo/21fashionstreetlogo.jpg','Bangalore','Karnataka','560071','India','919901946905','21fashionstreet@gmail.com',NULL,7,0),(9,'Socialheart','socialheart','SocialHeart is a website which allows you to buy exclusive products from NGOs and other social enterprises. Every product you buy contributes to a cause.\r\nSocialHeart is an online marketplace for socially responsible organizations and people. You get access to unique artistic products from NGOs. We let you discover the people behind the products with a complete profile of the organization/person. Every purchase you make from this website contributes to a cause. It could be to help save homeless puppies, or help spread literacy to rural India, or help provide livelihood to underprivileged women.','http://www.socialheart.in/','','company/logo/socialheart.png','Bangalore','Karnataka','','India','+91-9611133330','info@dailystation.in',NULL,7,0),(10,'Zyoba Labs Pvt. Ltd.','zyobalabs','Zyoba Labs is a new media and software development company based out of Nepal. Their competency lies in digital strategy, mobile application development (iOS and Android), web application development using various frameworks and languages, digital marketing, etc. They have already been able to sign up clients from US, UK, India and Malaysia. As its technical team is based in Nepal, a developing economy with low human resource cost, we provide quality services at an extremely affordable cost.\r\nSpecialties-\r\nDigital Strategy, Digital Marketing, SEO/SEM, Social Media Marketing, Mobile Application Development, Web Application Development','http://www.zyobalabs.com/','','company/logo/zyobalogo.jpg','Kathmandu','','','Nepal','+91- 84668 12456','hi@zyoba.com',NULL,7,0),(11,'Amgonna','amgonna','The new frontier for people technologies is to bring complete strangers together based on shared intentions, interests and passions in trusted environments. At amgonna, we believe it is not enough if you friend somebody online. The experience of connecting in the real world cannot be replaced by a virtual one. Every person we meet can be a key to unlock a new world.','http://www.amgonna.com/','http://vimeo.com/27092432','company/logo/amgonna_orange.png','Hyderabad','Andhra Pradesh','','India','','team@amgonna.com',NULL,7,0),(12,'Paste On My City','pasteonmycity','PasteOnMyCity is the social network for you and your city. Its the easiest way for you to connect share and collaborate with other users and businesses in your city. And the best part, its free!','http://pasteonmycity.com/','','company/logo/pomc-logo.png','Hyderabad','Andhra Pradesh','','India','','reachout@pasteonmycity.com',NULL,7,0),(13,'Pinpuff','pinpuff','Pinfluence is measure of your popularity, influence and reach on Pinterest. It also decides monetary value of your pins & traffic your pins generate. \r\nWe are doing some really cool stuff around Pinterest and first 1000 beta users will get exclusive invite to try out our experiments with Pinterest well before it is opened for all. - See more at: http://pinpuff.com/contact.html#sthash.qzuSOqsD.dpuf','http://www.pinpuff.com/','','company/logo/pinpuff-logo.png','','','','','','contact@pinpuff.com',NULL,7,0),(14,'HopOn','hopon','Provides the mix of best in class technology, product design and development to provide solutions to ever increasing traffic problems. Our goal is to constantly strive to reduce the travel time, carbon emissions \r\nand money spent by common man to reach his destination.\r\nHopOn started with a small idea of optimizing cab services to overcome under utilization of cabs in India which can revolutionize rider experience by creating alternate mass transit system. To beat the hurdle of high cost, we came up with an idea of dynamic car pooling for cabs which also optimizes waiting time for the riders implemented through desktop application for radio cab operators.','http://www.hopon.co.in/','http://www.hopon.co.in/home/video','company/logo/hopon-logo.png','Bangalore','Karnataka','560050','India','(+91) 888-411-4220','',NULL,7,0),(15,'Cloudsgreen','cloudsgreen','They believe in the principle of \'KISS\' which means \'Keep It Simple,Stupid\'. This site allows every one of us to generate, store, manage e-receipts making life much easier and happier.For every one of us: adhering to above principle this site allows every one of us to store e-receipts and manage day to day accounts giving ourselves more time with family and friends. You make strategies to run your business/home and just leave the petty receipt and payments management to the site.','http://www.cloudsgreen.com/about.php','','company/logo/cloudsgreen-logo.jpg','Warangal','Andhra Pradesh','','India','+919177629031','shashankpawar7@gmail.com',NULL,7,0),(16,'3G Cell Labs','3gcelllabs','Cell Labs is a software products and solution provider with a market niche that enables development of solutions within the Machine-2-Machine technology domain. Founded in February 2008 by a group of technology specialists with a vast experience in the systems used for data communication within M2M  Telecom, our team has a thorough working knowledge of the various elements that make up 2G/2.5G and 3G telecom networks including the various underlying communication methodologies between the elements.','http://www.celllabs.com/','','company/logo/3glabs.png','Hyderabad','Andhra Pradesh','500 034','India','+91 40 65896100','contactus@celllabs.com',NULL,7,0),(17,'Sloka','sloka','Sloka Telecom is a Radio Access Network (RAN) solution provider. It is a pioneer in designing, developing and selling compact and cost-effective Base Stations and Consumer Premise Equipment (CPE) for new standards- WiFi 11n, 11ac and WiMAX. Sloka uses its revolutionary patent-pending architecture (SDBSA) that gives it a technology and price advantage in making the smallest and cheapest base stations and CPEs.','http://www.sloka.in/','','company/logo/sloka-4.jpg','Bangalore','Karnataka','560 075 ','India','+91 80 4127 9526','info@sloka.in',NULL,7,0),(18,'ADS Projects & Systems Pvt. Ltd','ads-projects-systems','ADS Projects & Systems Pvt. Ltd. is a progressive and dynamic technology specific innovative business solutions provider, which offers a wide spectrum of management consultancy services to provide best value for money for the client. We are committed to provide end to end solutions that range from the visualization to formulation and from actual implementation to its successful launch. We have a clear focus on the needs of our clients to solve all their problems and challenges; and are committed to deliver quality projects on time and within budget. We believe that space ship earth is not a metaphor but a hard reality and therefore we are aiming to build a green and sustainable future. ','http://www.adsprojects.co/','','company/logo/ads.jpg','New Delhi','','110001','India','+91 - 783 878 4433','',NULL,7,0),(19,'eSrijan Innovations Pvt. Ltd.','esrijan-innovations','eSrijan Innovations Private Limited specializes in creation of innovative Automation Products & Solutions. eSrijan innovations are a combination of one or more of various Engineering streams, &/or Medical Systems, with applied Science & Technology. eSrijan Products are primarily targetted for the Indian majority. And, eSrijan Solutions are customized OEM products for specific customers.In product space, eSrijan is creating energy & education related products. In the solution space, it has its say in both rural and urban automation, ranging from daily chores to automotive. eSrijan is driving its solution development from its head-quarters in Bangalore, India','http://esrijan.com/','','company/logo/esrijan_logo_complete.png','Bangalore','Karnataka','560046','India',' +91-80-41172397','products@eSrijan.com',NULL,7,0),(20,'Srisaa Labs','srisaa','About Srisaa LabsSrisaa Labs is started in April 2007 with a vision to deliver product engineering services / outsourced product development services to startups and ISVs. The promoters with strong experience in product engineering and business analysis, have built Srisaa Labs into an organization delivering high quality and robust applications for our customers. The vision of the organization is to help start-ups and ISVs become successful and inturn help us become more successful.','http://www.srisaa.com/','','company/logo/srisaa.png','Hyderabad','Andhra Pradesh','500081','India','+91 40 40178781','info@srisaa.com',NULL,7,0),(21,'100 Century Labs','100-century-labs','100Century Labs was founded to promote practical innovation. We do not believe in innovating for the sake of it, but innovate to solve real problems that have the potential to disrupt markets or create new markets. Led by professionals with a solid industry experience and a global vision grounded by local realities, we are focused on promoting innovation by coupling it with flawless execution as we take great ideas to reality.','http://www.100centurylabs.com/','','company/logo/100-century-logoblackblue.jpg','Hyderabad','Andhra Pradesh','500036','India','040-23547119','',NULL,7,0),(22,'BHEA Knowledge Technologies','bhea','Bhea is a web development company providing web development services of any complexity to clients worldwide. Also BHEA is SugarCRM India partner and specializes in SugarCRM consulting, development, managed services, and systems integration.. \r\n\r\n','http://www.bhea.co.in/','','company/logo/bhea-logo.png','Bangalore','Karnataka','560 076','India','91 22 6687 9790','',NULL,7,0),(23,'Sevana','sevana','Sevana, largest manufacturer of packaging machines in the country, Our commitment to innovation, quality, support made us the leaders. Sevana has a comprehensive range of packaging machines including pouch-sealing, fill sealing, shrink wrapping, vacuum packaging, modified atmosphere packaging, controlled atmosphere packaging, coding machines, induction sealers, bulk packaging, flexi packaging, L sealers, sleeve wrappers, POF films, vacuum pouches etc.','http://www.sevana.com/','','','Kochi','Kerala','683 562','India','+91- 484 - 2680780','mail@sevana.com',NULL,7,0),(24,'Comtel Technologies','comtel-technologies','It is a global off-shore development and information technology organization providing solutions to enterprises world-wide for more than a decade. Comtel has successfully implemented projects independently as well as with partner organizations. This has helped Comtel in developing an in-depth understanding on every aspect of IT with issues ranging from Har','http://www.comteltechnologies.com/','','company/logo/comtel-logo.gif','Kolkata','West Bengal','700064','India','+91 (0)33 40041393','sales@comtel.co.in',NULL,7,0),(25,'Saisha Creations','saisha-creations','Saisha is an affordable web design based in India. We offer services like web design, maintenance of an existing web site, and we also specialize in corporate logo to graphic design services. We provide graphic design for all your business needs and relevant content web site. ','http://saishacreations.com/','','company/logo/saisha.jpg','Palampur','Himachal Pradesh','176061','India','+91-1894231399','sales@saishacreations.com',NULL,7,0),(26,'OnUs Payment Services India Pvt. Ltd','onus-payment-services','OnUs is a closed loop payment services company. It is at the  startup stage and is incubated at NSRCEL at IIM Bangalore.','http://www.linkedin.com/redirect?url=http%3A%2F%2Fwww%2Eonuspayments%2Ecom&urlhash=TXAN&trk=OnUs+Pay','','','Bangalore','Karnataka','','India','','',NULL,7,0),(27,'Lead Robotics','lead-robotics','LEAD ROBOTICS IS A FORWORD PLANNING STRATEGIC ROBOTICS COMPANY WHICH BELIEVES IN EMPOWERING THE APPLICATIONS OF ARTIFICIAL INTELLIGENCE BY FULLY TAKING ADVANTAGE OF THE LATEST POSSIBILITIES DEVELOPMENTS IN THE OTHER FIELDS SUCH AS PHYSICS, MECHATRONICS, MEDICINE, INDUSTRY ETC FOR MAKING HUMAN LIFE EASY AND FRUITFUL WITH A SENSE OF SOCIAL RESPONSIBILITY FOR MAKING THE EARTH A MUCH DESIRABLE PLACE TO LIVE FOR THE FUTURE GENERATIONS. FOR THIS GOAL, IT IS READY TO PARTNER AND CATALYSE THE ROBOTIC ACTIVITIES TO MAXIMISE THE SPEED AND APPLICATIONS OF THE DISCOVERIES AND BREAK THE NEW BARRIERS IN THE FIELD OF SCIENCE AND TECHNOLOGY.','http://www.leadrobotics.com/','','company/logo/madan.jpg','Hyderabad','Andhra Pradesh','500082','India','','',NULL,7,0),(28,'Phoenix Green International School','phoenix-green','he School is founded with an aim to impart value based, child-centric education utilizing global best practices for academic excellence and a foundation for leadership.\r\n\r\nPhoenix Greens School of Learning is promoted by alumni from IIT, IIM,NIT, American Universities and Sainik School, Korukonda. They include NRIs, doctors, engineers, senior army officers and entrepreneurs with global management experience.\r\n\r\nWith a firm foundation on values and discipline, the School of Learning imbibes rich experience and expertise of the founders, along with their ambition to develop future leaders in the competitive global environment.','http://www.phoenixgreens.com/','http://www.youtube.com/user/ThePhoenixGreens','company/logo/logo1.jpg','Hyderabad','Andhra Pradesh','500 032','India','91-40-64637100','info@phoenixgreens.com',NULL,7,0),(29,'ComMedia Solutions Pvt. Ltd','commedia-solutions','ComMedia provides solutions and services across the Indian subcontinent and in the emerging markets . The company has aggressive plans and is poised for very healthy growth rate . The company believes in partnerships and has developed ecosystem of partners to address the ever growing complex requirement of the customers. The company specializes in providing end-to-end solutions in wireless, wireline and media domain, this covers the entire gamut of services that includes design, build, operate, and maintain. The company with its expertise and experience is investing disproportionate efforts and has added set of rich in-house features to each of the solutions to present a comprehensive offering to its customer.\r\n','http://commediaindia.com/','','company/logo/logo.jpg','Mumbai','Maharashtra','400614','India','91 2241 234544','sales@commediaindia.com',NULL,7,0),(30,'Softforce Consultants Pvt Ltd','softforce-consultant','The team represents a diverse mix of skills; skills that have been acquired by working in some of the best known companies. These companies range from US based Corporations to Global Delivery based organizations, and from innovative Software Product companies to trailblazing players in Software Services.','http://www.softforceapps.com/','','','','Santa Clara,CA','95051','USA','+1-408-730-2366','info@softforceapps.com',NULL,7,0),(31,'Musa India','musaindia','Musa Software Engineering Pvt. Ltd. is founded by software veterans who have considerable experience in Software Quality Management. Pooling in their knowledge they now help other organizations in building Quality Management Systems, obtaining ISO certifications and SEI CMM, SEI CMMI assessments. Musa handles the entire Quality Department through a fully outsourced model where entire Quality Department personnel including Management Representative will be from MUSA. They also help organizations in training their QA personnel , offer Risk Consultancy for Software projects and help them in building Knowledge Management Systems.\r\n','http://www.musaindia.com/','','company/logo/musa1_1.gif','Bangalore','Karnatak','560011','India','','sastryva123@gmail.com',NULL,7,0),(32,'2ctechcorp','2ctechcorp','2C Tech Corporation, is a Colorado-based biotech company which is developing a medical device based on nanotechnology. The result of this development effort is the unique, patent pending SeeQ device involving intraocularly delivered photoactive nanoparticles, particles which convert light to electrical energy, similar to a conventional solar cell but on a sub-cellular scale.\r\n   \r\nThis technology is going to help millions of people suffering from various ocular diseases such as retinitis pigmentosa, retinal detachment, diabetic retinopathy, and macular degeneration, which ultimately lead to diminished sight and eventually blindness.','http://www.2ctechcorp.com/','','','Irvine','California','92618','USA','+1 949 420 0806','rrao@mail.com',NULL,7,0),(33,'lensgen','lensgen','LensGen is developing a novel solution to treat presbyopia(condition where, with age, the eye exhibits a progressively diminished ability to focus on near objects) . The LensGen product, under development, is designed to restore youthful vision to anyone over the age of 45 without spectacles, contact lenses and LASIK.','http://www.lensgen.com/','','company/logo/360_LensGenLogo1_copy.png','Irvine','California','92618','USA','(949) 420 0814','mlandreville@lensgen.com',NULL,7,0),(34,'SM group of companies','smgroup','The SM Group is a family-driven professionally-managed business house headquartered in Guwahati,with revenues of over Rs 500 Crores and operations in Assam, Meghalaya and West Bengal. It was established in the year 1960 by Late Mohan Lalji Jain as a partnership firm Shewprasad Mohanlal with primary interests in Steel and Finance. Today the  SM group has forayed into diversified fields such as Metallurgy, Automobiles, Road Building Technology,Real Estate etc.\r\n','','','','Guwahati','Assam','781 005','India','+ 91 361 2450020','hr@smgrp.net',NULL,7,0),(35,'Progressive Constructions Limited','progressiveconstructions','Progressive Constructions Limited, is one of the premiere construction companies in India, which is involved in construction of dams, powerhouses, barrages, canals, aqueducts, road ways, waterways, tunnels, industrial, commercial & residential structures.Progressives fields of operations are spread over many states of the Indian Union. They cater to the creation of infrastructure to a wide spectrum of sectors like Irrigation, Power, Water, Rail, Transport, Health, Housing, Industrial & Commercial establishments.\r\n','http://progressiveconstructions.com/','','company/logo/maintitle_index.gif','Hyderabad','Andhra Pradesh','500 001','India','+91-40-2320 4684','contact@progressiveconstructions.com',NULL,7,0),(36,'Kmc Constructions','kmcgroup','KMC Constructions commands unexcelled expertise in infrastructure building, entwined with rich technical prowess in the construction of roads, multi-lane highways, airport runways, bridges, housing projects, business multiplexes and so on.\r\n\r\nWith a pan Indian presence, KMCs able management translates its vision of vitalizing the nations strength, taking the company forward at a rapid pace as one of the fastest growing players in the field with dynamic and experienced team expanding horizons in Infrastructure, Energy, Ports, Reality and the Coastal Corridor while delivering consistent returns to all its stakeholders.\r\n\r\nA visionary management team, competent and well qualified professionals, efficient manpower, technologically superior plants and machinery, along with an operational code of conduct bearing the highest degree of professionalism across the entire organization, KMC group is recognized as one of most revered premium infrastructure company across the country.','http://kmcgroup.co.in/','','','','','','','','',NULL,7,0),(37,'Pete Transformers','petetransformers','PETE - Hammond Power Solutions Pvt. Ltd. is a leading Manufacturer of Power and Distribution Transformers in India with over 24 years of Manufacturing and servicing experience. They manufacture Oil Cooled Transformers Dry Type Transformers and Furnace / Arc Furnace Transformers.PETE - HPS offers Power Transformers with Innovative Designs and Consistent Quality of high order at Competitive Price. The company Pete Transformers was found by Mr K Linga Reddy 24 years ago. They entered into a partnership with international Company Hammond Power Solutions in 2012 .','http://www.petetransformers.com/','','company/logo/pete_hps_logo.gif','Hyderabad','Andhra Pradesh','500018','India','+91 40 23812291 ','marketing@petetransformers.com',NULL,7,0),(38,'Nandi Group','nandigroup','Nandi Group is a leading business group led by Founder and Chairman Mr S.P.Y.Reddy. The Group is leading player in PVC, HDPE, CPVC,uPVC pipes. The group was started as a small unit of manufacturing of Plastic containers in 1978. It was later expanded to manufacturing of PVC and allied pipes under the brand \"Nandi\". The group is a major player is Agricultural Pipes, Casing Pipes, Submersible Pipes, Ring Fit Pipes, Plumbing Pipes, Electrical Pipes, Sewer Pipes. It also major player in Water Storage Tanks and Solvent Cements. Over the last decades the group has diversified into different businesses and has presence in Cement ,Infrastructure , Tmt Bars, Agro products and Dairy Industry.','http://nandigroup.in/','','','','','','','','',NULL,7,0),(39,'Vinyl Chemicals India','vinylchemicals','M/s. Vinyl Chemicals India Ltd , A Parekh Group company is in the business of selling various speciality chemicals mainly to textile, paints and adhesive sectors since 1991','http://www.vinylchemicals.com/index.aspx','','','','','','','','',NULL,7,0),(40,'Auro Associates','auroassociates','AURO is a team of highly qualified, internationally experienced Technocrats and dedicated Professionals from various fields. AURO is into Process-Project consultancy and provides Chemical, Pharma, Herbal and CO2 Recovery plants on Turnkey Basis with Technology Transfer','http://auroassociates.com/','','','','','','','','',NULL,7,0),(41,'Solar Semiconductor','','Solar Semiconductor is a pioneer in offering innovative solutions that leverage Sun\'s energy to address various demands for electricity. With offices in USA, Canada, Dubai and manufacturing operations in Hyderabad, India, Solar Semiconductor is an international organization that offers  PV solutions, products and services to worldwide markets including the Americas, Europe, Asia and Africa. \r\n\r\nSolar Semiconductor is a vertically integrated full-service Systems provider, which also manufactures its own PV modules and cells. It specializes in turn-key Solar Power plants for utilities, Government, commercial as well as residential market segments. In addition, off-grid applications such as rural electrification, water pumping and cell towers are also addressed. \r\n\r\nOne of the leading manufacturers of high quality Solar Photovoltaic PV Modules.  \r\n\r\nSSPL\'s Solar PV Modules are manufactured in its ISO 9000 certified world class manufacturing facility located at Hyderabad; SSPL produces modules of different configurations which are certified to the requirements of IEC 61215, UL , TUV CSA and MNRE specifications for use in large PV Solar PV Plants, Roof Top PV plants, Home lighting, street lighting and other PV applications.','http://www.solarsemiconductor.com/','','','','','','','','',NULL,7,0),(42,'PB Systems','pbsystems','PB Systems, Inc. is a premier global Information Technology Services and Solutions Provider offering the highest overall value and customer satisfaction in the industry.','http://www.pbsystems.com/','','','','','','','','',NULL,7,0),(43,'Semantic Space','semanticspace','SemanticSpace Technologies Limited (SemanticSpace) was founded in 1997 with a mission to creatively unlock high-value for our customers by simplifying IT.  With its strong global presence across the US, Europe and Asia, SemanticSpace has serviced over 400 marquee customers and delivered over 1000 projects to date.  By combining application frameworks, prebuilt components, custom development expertise, a governance framework and a blended shore model, SemanticSpace helps organizations decrease risk in complex software development and deployment investments, improve time to market and increase success of business strategy execution.\r\nSemanticSpace is comprised of three key business units  SST, Arsin and Prolifics  that respectively provide Application Services, Independent Verification and Validation Services, and Systems Integration Solutions in the Application Infrastructure and Middleware space. ','http://www.semanticspace.com/','','','','','','','','',NULL,7,0),(44,'Bhargava Industries','bhargavaindustries','','','','','','','','','','',NULL,7,0),(45,'Menthatech','menthatech','','http://www.menthatech.com/','','','','','','','','',NULL,7,0),(46,'Excel Corporation','excelcorporation','','http://www.excelcorporation.in/','','','','','','','','',NULL,7,0),(47,'EFCO India','efcoindia','EFCO India is a Joint Venture Company, promoted by EFCO Maschinenbau \r\nGmbH, Germany.\r\nEFCO India is certified by the API (American Petroleum Institute), for Repair, Remanufacture and Service of Valves.\r\nEFCO India carries out on line Testing of Safety & Relief Valves with the Legatest - a PC based testing equipment.\r\nEFCO India carries out turnkey flange facing work.\r\nEFCO India manufactures a range of Universal Valve Test Benches.\r\nEFCO India offers a range of stationary and portable machines, especially for the Valve Repair Industry.\r\nEFCO India offers online lubrication and sealing services for both Reactive and Preventive Maintenance Services of High Pressure Valves in Oil Drilling Platforms and in Cross Country Pipelines.\r\nEFCO India offers a turnkey LDAR programme to contain Fugitive Emission.\r\nIn the recent past, EFCO India has provided technical consultancy for setting up Valve Repair Shops in neighbouring Countries.','http://www.efcoindia.com/','','','','','','','','',NULL,7,0),(48,'Travel Express Ltd','travel-express','Travelexpress is a retail travel agency with focus on Corporate, Corporate Leisure (Individual & Groups), Incentive/Conference Groups, Individual Holidays & etc., In addition to individual hotels reservations, the company has varied experience in handling groups of sizes between 15 and 300 to Australia, Schengen Countries, UK, South Africa, New Zealand, Singapore, Thailand, Malaysia, Indonesia & Sri Lanka.With a professional team to handle, Travelexpress is a one stop solution for any and all travel and related solutions like Air Tickets, Visas, Holiday Packages (both domestic & international), Hotel & Car Reservation, Foreign Exchange, Overseas Medical Insurance, Global Mobile SIM cards and others.','http://www.travelexpress.in/','','company/logo/travel-express_01.jpg','Hyderabad','Andhra Pradesh','500016','India','040-23358855','ranganath@travelexpress.in',262,7,1),(49,'Geodesic Techniques','geodesic-techniques','The company was built with the objective of offering technically superior solutions for steel intensive construction. Over the years, the company has built expertise in the integrated design, engineering, procurement and construction process. The company is led by a team of qualified and experienced professionals with over four decades of experience. Today, Geodesic has established itself as a leading provider of large span, pre-fabricated, steel-intensive and innovative structures including high-rise steel buildings, signature structures, commercial & retail structures, public Infrastructure utilities, Industrial structures and urban transportation systems. We are led by a team of qualified and experienced professionals with four decades of experience in civil engineering, architecture, mechanical engineering, structural engineering, construction management and contracts management. Currently, we have nearly 400 man-power in six offices across the country and our objective is to double it. Geodesic is committed to improving the quality of urban life through its proven capabilities in engineering and industrialized construction. We have entered into strategic tie-ups with international leaders to offer end-to-end world class solutions to our clients.','http://www.geodesictechniques.com/','','company/logo/geodesic.png','Bangalore','Karnataka','560058','India','91 80 6745 1200 ','enquiry@geodesictechnqiues.com',262,7,1),(50,'8kpc Inc.','8kpc','8kpc Inc. builds software products for file services focused on new and emergent enterprise architectures. The core 8kpc technology is the CS2 platform, a powerful distributed storage solution. The CS2 platform forms the basis of the company\'s product line which includes:\r\n8VSA: A scalable stand alone storage solution for public and private clouds\r\n8VCA: A scalable front-end cache solution that extends existing infrastructure to cloud stacks\r\n8ESA: An enterprise wide storage acceleration and optimization solution that enables efficient management of data in large multi-datacenter enterprises\r\nThe company\'s products are deployed in large Fortune1000 companies and is gaining traction in a wide variety of industries including: Semiconductors, Media, Healthcare and Financial Services.','http://www.linkedin.com/redirect?url=http%3A%2F%2Fwww%2E8kpc%2Ecom&urlhash=TR-O&trk=8kpc+Inc%2E_webs','','company/logo/8kpc.png','','CA',' 95035','USA','','info@8kpc.com',262,7,1),(51,'Bartronics Inida Ltd','bartronics','Bartronics started with providing solutions based on Bar Coding, one of the oldest AIDC technologies. Since then, in the past two decades, it has been pioneer in introducing newer technologies and solutions in India based on Biometrics, RFID, POS, EAS, and Smart Cards etc. The company has always been at the forefront in most of the technologies under the AIDC umbrella and will strive to continue this for delivering improved value to the customers. Their knowledge of products, technologies, implementation skills and understanding of the market place make us a dominant player in the domestic markets, and help us share exclusive relationships with many of the leading vendors in the world. Their total solution approach offers customers confidence in investing and initiating innovative business processes for prompt, accurate and secure data capture and mobile computing needs.','http://bartronicsindia.com/','','company/logo/bartronics.gif','Hyderabad','Andhra Pradesh','500 034','India','040 23606316','info@bartronicsindia.com',262,7,1),(52,'Athene Security Solutions','athena-security','Athena Security Solutions INDIA Private Limited (ATHENA) is an independent provider of specialized security services, intelligence and security training, consulting and technology to the corporate, government, law enforcement and non-governmental markets.It  provides, Risk Assessment, Strategy Development, Marine, Strategic Facilities & VIP Protection, Training, Consulting and Investigation services.Our management and associates bring with them years of unique operational experience in combating terror, analyzing threats, developing strategies and deploying technology and trained personnel to combat the risks. In addition the experience and knowledge of the Defense & Security industry enables us to better understand and represent technologies and products for our clients.','http://athenasecurity.org/','','company/logo/athena_logo.png','Hyderabad','Andhra Pradesh','500081','India','91-40-40150002','info@athenasecurity.org',262,7,1),(53,'Vamshi Rubber Ltd','vamshi-rubber','Vamshi Rubber Limited has emerged as a name to reckon with in the tyre retreading material manufacturing industry and in confidently poised today to become the market leader with ISO 9001-2008 certification.The modern precured retreading cold process ensures better performance with increased durability and working miracles in terms of comfort, traction, long life and fuel economy.VRL\'s complete manufacturing facility has a capacity to produce 3200 MT of Precured Tread Rubber, 400 MT of Cushion Gum and 400 KL of Vulcanizing Solution annually. Exceeding expectations in quality, to meet international standards and catering to requirements that are numerous and complex, VRL\'s value springs from its excellent and extensive product benefits. ','http://www.vamshirubber.org/','','company/logo/vamshirubber.png','Hyderabad','Andhra Pradesh','500034','India','91-40-23353280','',262,7,1),(55,'SoftSol','softsol','SoftSol is a world class IT services provider that empowers its customers towards greater efficiency, innovation, compliance, and cost savings.  Headquartered in Californias Silicon Valley, SoftSol has been a driver in the evolution of IT through web and SOA to collaboration, cloud, and mobility. Combining fundamental business strategies with bold moves in technology innovation, SoftSol has been assisting organizations such as the Department of Defense, Genentech, CalPERs, Cisco, the Superior Court of California, and HBO towards leadership in their respective industries. SoftSol is CMMi Level 3, IS0 9001, and ISO 27001.  SoftSol is a Microsoft Gold Certified Partner, HP Silver Partner, and Oracle partner, as well as a member of the Oracle Modernization Alliance and Mainframe Migration Alliance.The specialities are Technology Modernization, Next Generation Software testing, acceptance testing products and servies, Case Management for Legal and court solutions.','http://www.softsol.com/','','company/logo/softsol.png','','California','94538','USA',' 510-824-2000','info@softsol.net',262,7,1),(56,'Business Zenz','business-zenz','Buisiness Zenz helps you with Strategy and abilty of execution of any organization.Business Zenz can help you define organization structures and processes, help you establish the required leadership structure and travel with you while you implement it.I can also help you define your strategies, hoshin plans and define a balanced score card for your company. It can also help you set up an organization (structurally and culturally) that can deliver innovation.Business Zenz will mentor senior managers, undertake OD initiatives, challenge project and program management wisdom, assist in driving a culture of Innovation and help in evolving organisational cultures.','http://businesszenz.in/','','company/logo/businezzzenz-logo.png','Bangalore','Karnataka','560072','India','91 98450 28193','bhaskaran.s@businesszenz.in',262,7,1),(57,'Wellbound Worldwide','wellbound-worldwide','Welbound went on to change the way books are bound in India. Since then, Welbound has developed more than 15 products and variants, with indigenous expertise. From folding to trimming, the products complete the book binding cycle.The tie up with world leaders in adhesives, Henkel Adhesives (erstwhile National Starch and Chemicals) has helped Welbound deliver complete solutions to the book binding industry. With their support, technical seminars and application training sessions are hosted all over the country to increase awareness in book binding techniques.Welbound designs and develops majority of the products with indigenous expertise. Welbound also has tie up with a few European manufacturers for the production of their machines and accessories in India. A well established sales and service network takes care of installations and training - on machine as well as application.','http://www.welbound.com/','','company/logo/wellbound.png','Mumbai','Maharashtra','400072','India','91 (022) 2859 6960 ','welbound@gmail.com',262,7,1);
