INSERT INTO `innovation_innovationupdate` VALUES (1,1,'2014-03-15','Had call with Joby:\r\n1. Decide on type of design (Dumb system)\r\n2. Design calculations (50, 100, 250, 500 kgs)\r\n- Total power consumption (Watts)\r\n- Compressor Specifications\r\n- Power Comparison with roller/trolley systems\r\n- Design specs for the pad for all weights'),(2,1,'2014-04-28','Submitted Excel sheet with calculations for various loads. Modified by Joby on 10th May'),(3,1,'2014-05-15','Had Call with Joby to discuss what parts to procure to start prototyping\r\n1. Buy valve\r\n2. Invest on good pressure gauge\r\n3. Adjusting air quantity: Do it manually. Need not change in flow pressure, valve can be used if we need to change it.\r\n4. Force Gauge: Need not buy now. Postpone when prototype has matured\r\n5. Wood plank spec: MDF\r\n6. Try to get hand grinder (~Rs.1500)\r\n7. Calc diam based on pressure and Vol flow rate and send to Joby\r\n'),(4,1,'2014-05-20','Had Call with Dr. Anjaneyulu to discuss progress. Swatchit to meet Dr. Anjaneyulu today evening with document containing progress and requirements.\r\n\r\nDr. Anjaneyulu to help Swatchit arrange for lab permissions and applying for advance.'),(5,2,'2014-05-19','Had call with Anand to discuss progress. Arranged for call on 20th with Dr. Anjaneyulu. Sent revised timeline.'),(6,2,'2014-05-20','Had a call with Dr. Anjaneyulu today. Rohit updated us on the progress and sent a list of items to be procured. Will have another call next week (29th/30th)'),(7,3,'2014-05-20','Had a skype call with Kamlesh and Faisal today with Dr. Anjaneyulu and Anand Rajagopalan. They sent the detailed technical document via email.\r\nHad doubts regarding material to be used and how to make the climber more user friendly (pushing load vs pulling load). Will connect them to Joby for more help.\r\nWill have second update skype call on 29th/30th.'),(8,3,'2014-05-24','Had call with Faisal, Kamlesh, Joby, Anand\r\nFaisal and Kamlesh to work on:\r\n- Force calculation: Calculate the amount of effort needed to raise \'x\' weight up staircase. Essentially prove that the system is more efficient than directly lifting weight over head/shoulder.\r\n- Explore: Browse the web for different existing solutions\r\n- Keep an open mind: Try to innovate on the mechanism. Can we use pedals to lift weight? Will that be a simpler solution?'),(9,3,'2014-06-09','TODO for next meeting: Revise calculations and get back by this week\r\n============\r\nDiscussed force calculations. We have to determine the efficiency of such a system over conventional methods of lifting loads over a staircase. Unless we have this, we cannot proceed with design as we will not have any proof that the system is worth the effort\r\n============\r\nQuestions by Joby about calculations:\r\n1) Below equation is for Frictional force not frictional energy (correct me if i am wrong).\r\n2) Why do we need to consider work done for porter movement? Why not only pay load? Please share your thought process\r\n3) In your calculation \"3. Motion up the Stairs\" section:\r\nThe force is calculated considering the body is moving along a slope profile but in actual case the system works on a staircase. Therefore the force required will be more to lift the body from one step to another.\r\n\r\nAnswers by Faisal:\r\n1.Yes your absolutely right that the given calculation is for frictional force. \r\n   What i then did is multiply it with the distance travelled to get the workdone.\r\n   In some cases the distance was taken as 1m. And hence I took forward the force into energy. Maybe that might have caused some confusion.\r\n\r\n2. When I first did the calculations , i took only the payload. In the (non-trolley or first) case even the porters weight was necessary to be added to determine the reaction force. When in the second case (with trolley ) the porter movement was excluded. This gave huge changes in values and made the trolley very very efficient. I then thought that at the end of first case even the porter and the object had moved the distance and both were accommodated within the calculations whereas the porter was absent in the second one even though in real process to move the trolley the porters movement is required. I also felt that in using the trolley the porter will be putting a significant effort to move himself along with trolley.\r\n\r\nIf necessary we can remove the porters movement while using the trolley. However they must be considered while not using the trolley\r\n'),(10,1,'2014-06-14','A complete weekly update was given over Skype on 14-06-2014\r\n\r\nProblems Faced:\r\n\r\n1) Improper base shape i.e Lack of symmetry \r\nRemedy   1) Try to use one more inlet for air.\r\n               2) Try to adjust the mean position.\r\n\r\n2) Adherence problem between MDF and Nylon\r\nRemedy 1) Rubber Based Glue\r\n               2) Eraldite + M-Seal\r\n\r\n3) Pressure gauge problem\r\nRemedy - Use the other side to fix the gauge and then check.'),(11,3,'2014-06-29','Discussed how to calculate work done to prove that device is useful over person lifting load. Faisal sent revised calculations.'),(12,3,'2014-07-21','For tomorrow night:\r\nWhat force do you need for spring?\r\nSend drawings of springs\r\nSend calculations\r\n\r\nAugust 4th:\r\n3D model of system based on calculations with final dimensions\r\n'),(13,3,'2014-08-10','These are the highlights of today\'s call.\r\n\r\n- Review gearing system. Try to replace with belt-drive, worm gear or chain drive.\r\n- Check design dimensions of spring system .\r\n- Provide thicker cross-section or protrusion to increase brake contact / effectiveness.\r\n- Try to reduce impact while release of spring occurs.\r\n\r\nThese issues will be addressed by next week.\r\n'),(14,3,'2014-09-29','---------- Forwarded message ----------\r\nFrom: Joby Yeldo <jobyyeldo@gmail.com>\r\nDate: 29 September 2014 08:31\r\nSubject: Re: Tristar Update 28-09-2014\r\nTo: Syed Faisal <syedfaisal333@gmail.com>\r\nCc: Anand Rajagopalan <anandr31@gmail.com>, Souradeep Roy <souradeep30@gmail.com>, Kamlesh Munda <kamlesh.mech.nitw@gmail.com>\r\n\r\n\r\nHi Faisal\r\nThanks for the update. Pls check with local engg workshop (place where grills and gates are made) for making frame. I guess they can make it as this is not so complicated. Sometime you may have to change your dimensions slightly to make telescopic arrangment with standard pipe.\r\nJoby\r\n\r\nOn Sep 28, 2014 3:57 PM, \"Syed Faisal\" <syedfaisal333@gmail.com> wrote:\r\nHello all,\r\n\r\nAfter the exam week the updates are as follows.\r\n\r\n1. Kamlesh and Souradeep visited local fabricators/ steel manufacturers regarding the chassis of the trolley. Also details of manufacturers in hyderabad were also obtained.\r\n\r\n2. I visited Prof. Angenylu regarding transactions and he has asked us to give a list of all materials that will be purchased and their cost.\r\n\r\n3. We\'ve rounded up manufacturers about most of the other parts.\r\n\r\nWe are going to finalise the list of materials their cost, and their provider/manufacturer and submit it after the dhushera holidays to Prof.Angenylu and begin our purchases.\r\n\r\nWe have a slight dilemma regarding the extendable handle. Manufacturers of the same do it for trolley bags for travel and not for custom requirement( as we\'ll need slightly different ones from the normal). We are looking if we can make one ourselves but it seems complicated. If there is anything that can ease this part do let us know.\r\n\r\nThanks\r\n\r\nRegards\r\n\r\nSyed Faisal\r\n');
/*!40000 ALTER TABLE `innovation_innovationupdate` ENABLE KEYS */;
