INSERT INTO `people_teammember` VALUES (1,'Anand Rajagopalan','anand','Co-founder & CEO','team_pics/Anand_Rajagopalan_png.png','<p>Anand is from the NITW class of 2008. He worked as a developer for Oracle India for three and a half years before quitting to join Lakshya as a full-time employee. </p>\r\n<p>Today, he works as Lakshya\'s CEO. He conceptualizes projects and oversees their execution. He is also responsible for improving the synergy between alumni and institute by forging new partnerships. He heads the Innovation Project team and also looks into its IPR aspects. He is involved in nearly all activities from publicity to fund raising.</p>\r\n\r\n<p>During his college days Anand was the overall student coordinator of Spring Spree, NITW\'s three day cultural festival.</p>','https://www.facebook.com/anand.rajagopalan.547','http://in.linkedin.com/in/rajagopalananand','https://twitter.com/anandr31',''),(2,'Srihari Maneru','srihari','Co-founder & Trustee','team_pics/Sri_hari_PNG.png','Srihari, NITW class of 2008, is a co-founder of Lakshya. Soon after graduation, he joined Strand Life Sciences as Associate Software Developer before moving to Rang De, a microfinance NGO, where he grew to become Vice President. He now works as Member, Technical Staff for Boltell Infomedia.\r\n<p>At Lakshya, Srihari handles Technology and also  works with the executive committee to develop strategy for growing Lakshya</p>\r\n<p>Srihari was student council president in 2008 at NIT Warangal.</p>','https://www.facebook.com/sriharimaneru','http://www.linkedin.com/pub/srihari-maneru/17/824/943','http://www.twitter.com/sriharimaneru','http://sriharimaneru.wordpress.com/'),(3,'Rakesh Dubbudu','rakesh','Trustee','team_pics/rakeshDubbudu_1.jpg','Rakesh, NITW class of 2005, started out working for Oracle India and also founded Bhumi, an NGO working towards sustainable transformation of communities. He resigned from Oracle in 2010 to join Abhyaas EduCorp as its Director.\r\n<p>At Lakshya, Rakesh uses his experience and network to develop strategy for campus enablers for NIT Warangal. He develops the road-map and oversees execution for assisting the NIT Warangal administration in making its processes more transparent and efficient. Some of his work includes implementing section 4(1)(b) of the RTI Act 2005 in the institute and preparing requirements for automation of processes.</p>\r\n<p>He is a renowned RTI activist with distinguished awards such as the CNN IBN Citizen Journalist Award and the Basha Memorial Young Activist Award. His interests include studying public policy and the RTI Act.</p>','https://www.facebook.com/dubbudu','http://www.linkedin.com/pub/rakesh-reddy-dubbudu/19/409/238','',''),(5,'Vrishank Raghav','vrishank','Trustee','team_pics/Vrishank_png.png','Vrishank, NITW class of 2008, is currently pursuing his PhD in Aerospace Engineering from Georgia Institute of Technology and has worked at Toyota and Kimberly Clark.\r\n<p>At Lakshya, he is responsible for fund raising strategies, especially from the Americas. He also played a key role in establishing the Innovation Project.</p>\r\n<p>He has received several awards such as the Robert Wolfe Fellowship (2012), United Technologies Research Center Fellowship (2011) and the Vertical Flight Foundation Fellowship (2010). He was captain of the NITW basketball team and member of the institute athletics team.</p>','https://www.facebook.com/vrishankraghav','http://www.linkedin.com/pub/vrishank-raghav/32/5a2/a65','',''),(7,'Jaswant Adapa','jaswant','Student Coordinator','team_pics/Jaswant_Adapa_png.png','Jaswant handed over reins of Lakshya\'s Student Coordinator to Shine Eapen in 2013. He has set a high bar for all future student coordinators and has been as asset to the organization from the day he came in.\r\n<p/>','https://www.facebook.com/jaswantadapa','','',''),(8,'Shine Eapen','shine','Student Coordinator','team_pics/Shine_MathaiPNG.png','Shine is Lakshya\'s Student Coordinator. His current role includes executing projects in college and working for Lakshya\'s accounts and finances. He will be assisted by the two Associate Student Coordinators, Namini and Debajyoti, and all three represent Lakshya in the student community.\r\n<p>He is a Mechanical Engineering student from the Class of 2014.</p>','https://www.facebook.com/shine.eapen','','',''),(11,'Dr.J.Ramachander Rao','jrr','Trustee','team_pics/jrr3_png.png','Dr.J.Ramachander Rao was Lakshya\'s first Honorary Chairperson.\r\nHe completed his MSc.Tech and PhD from REC Warangal in 1974 and 1980 respectively.\r\n<p>His contributions in helping Lakshya strategize its projects in college during the initial days have been invaluable. Having held almost every position of responsibility in the college administration from department HoD, to Chief Warden, to the Dean, Dr.JRR is well versed with the processes required to keep an organization\'s operations transparent and efficient. </p>\r\n<p>He is currently a professor at the Department of Physics and the Chief Vigilance Officer at NIT Warangal.</p>','','','',''),(12,'Dr.A.Venu Gopal','venugopal','Honorary Chairperson','team_pics/Dr_V_Gopal_png.png','Dr.Venu Gopal is Lakshya\'s Honorary Chairperson. He completed his post-graduation from REC Warangal in 1990 and received his doctorate in Manufacturing Engineering from IIT Delhi in 2003.\r\n\r\n<p>His contribution to structure the innovation project has been invaluable. He uses his vast experience to frame effective models for encouraging research and innovation among students.</p>\r\n\r\n<p>Dr.Venu Gopal is a Professor in the Mechanical Engineering Department at NIT Warangal.</p>','https://www.facebook.com/venugopal.anne.5','','',''),(13,'Dr.K.Padma','padma','Managing Trustee','team_pics/padma.jpg','Dr.K.Padma is Lakshya\'s Managing Trustee. After an MA in Economics from Kakatiya University, Dr.Padma received her PhD from IIT Kharagpur in 1991. \r\n\r\n<p>She helped set up Lakshya\'s transparency and accounting frameworks. She looks after Lakshya\'s auditing and filing of returns. She is also part of Lakshya\'s administration automation team. </p>\r\n\r\n<p>She is currently Associate Professor at the NIT Warangal School of Management and has the additional charge of Deputy Registrar, Accounts at NIT Warangal.</p>','','','',''),(14,'Mr.Venkat Changavalli','venkat','Advisor','team_pics/Venkat_Changavalli.png','Mr.Venkat Changavalli completed his B.Tech from REC Warangal in 1975 followed by an MBA from IIM Ahmedabad. The highlight of his 34 years of experience was as CEO of EMRI. Under his leadership, the EMRI 108 ambulance service has responded to over 12 million emergencies and saved over 350,000 lives.\r\n\r\n<p>His leadership and experience in guiding several start-ups makes his involvement as member of Lakshya\'s advisory board all the more vital.</p>\r\n\r\n<p>Mr.Venkat Changavalli is currently a management consultant, leadership mentor, teacher, inspirational speaker and is a Director at the State Bank of Hyderabad.</p>\r\n','https://www.facebook.com/venkat.changavalli','http://www.linkedin.com/pub/venkat-changavalli/2/713/537','',''),(15,'Mr.Vasant Roy','vasanth','Advisor','team_pics/Vasant_Roy_png.png','Mr.Vasant Roy graduated from REC Warangal in 1980 with a degree in Mechanical Engineering and then received his MBA from IIM Bangalore in 1982.\r\n\r\n<p>His association with Lakshya dates back to 2010 when he personally procured high-end parts from abroad for Lakshya\'s first sponsored research project. Being an entrepreneur himself with amazing people skills, he adds immense value as advisor.</p>\r\n<p>Mr.Vasant Roy is currently the owner of EFCO Maschinenbau India Pvt Ltd.</p>','','http://www.linkedin.com/pub/vasant-roy/5/434/b7b','',''),(16,'Dr. V.A. Sastry','sastry','Advisor','team_pics/dr_va_sastry_advisor.jpg','Dr. Sastry is an RECW gold medalist in Electrical Engineering from the first batch that graduated in 1964. He holds a post-graduate degree from Indian Institute of Science and a PhD in Computer applications from the University of Waterloo in Canada.\r\n\r\n<p>He was the first non-promoter director on the Infosys board. He sat on the board for six years, between 1990 and 1996. Since leaving Infosys, he has helped around 300 IT firms in the area of quality management and promoted two companies, including one which was acquired by EDS Corp. He also invested and mentored companies through venture capital firm Erasmic Venture Fund which was merged with Accel Partners to form Accel India Venture Fund.</p>\r\n<p>Dr. Sastry now sits on the board of the National Stock Exchange.</p>','','','',''),(17,'Maruthi Sandeep','maruthi','Executive Member','team_pics/maruthi.jpg','Maruthi Sandeep is from the NITW class of 2012. He began his career as a business analyst with Mu-Sigma and now works with Boltell Infomedia.\r\n\r\n<p>At Lakshya, Maruthi works on publicity on and off campus. Maruthi was also the student coordinator for Technozion in 2011.</p>','https://www.facebook.com/maruthisandeep27','','',''),(18,'Ashok','ashok','Executive Member','team_pics/ashok.jpg','Ashok Reddy is from the NITW class of 2012. He was Lakshya\'s student coordinator in his final year and is now an executive member. He now works for Ashok-Leyland. </br>\r\n<p>Ashok has been instrumental in getting us our 12A and 80G exemptions and now handles finances, account and auditing for Lakshya.</p>','https://www.facebook.com/Ashok.NITW','http://in.linkedin.com/pub/ashok-reddy/36/85a/399','',''),(19,'Ginu Abraham George','ginu','Brand Developer and Designer','team_pics/ginu.jpg','Ginu is from the NITW class of 2013. He has joined Lakshya as Brand Developer and Designer.\r\n<p/>\r\nAt Lakshya, Ginu works on building the right image for Lakshya which portrays what we stand for. His work also includes conceptualizing and designing graphic applications such as collateral material, publications, merchandise and other media in addition to exploring innovative avenues for Lakshya to project its work.\r\n<p/>\r\nWhile in college, Ginu headed the Spring Spree 2013 design team and was responsible for all the art-work and innovative publicity content delivered by the institute cultural festival.','https://www.facebook.com/ginugeo','','',''),(20,'I.V. Naveen','naveen','Partner','team_pics/naveen_indala.jpg','Naveen graduated from NIT Warangal in 2013. His entrepreneurial ambition coupled with structured thinking made him a perfect fit to partner us in Lakshya\'s growth. \r\n<p/>\r\nHis role as Partner is to shape Lakshya\'s future course, streamline the organization\'s functioning and build capacity. His focus is to consolidate Lakshya\'s ongoing projects and produce road-maps for new ones. Given Naveen\'s experience as Head of Quality Control during Technozion 2012, he specializes in establishing processes to take Lakshya to the next level.\r\n<p/>\r\nNaveen pioneered Technozion\'s efforts in 2012 for an ISO certification, something which has brought professional structure to a college technical festival','https://www.facebook.com/nvn.gandhianengg','http://in.linkedin.com/pub/naveen-indala/49/59b/59b','',''),(21,'Debajyoti Khawas','debajyoti','Associate Student Coordinator','team_pics/Debajyoti_Khawas.jpg','Debajyoti is Lakshya\'s Associate Student Coordinator. He and Namini plan and organize Lakshya events in college and together with Shine, the student coordinator, are the faces of the organization on campus.\r\n\r\nDebajyoti is a Mechanical Engineering student from the Class of 2015 and is also part of the institute Quiz Club.','https://www.facebook.com/debajyoti.khawas','http://in.linkedin.com/pub/debajyoti-khawas/51/698/a44','',''),(22,'Namini Jenison Reddy','namini','Associate Student Coordinator','team_pics/namini.jpg','Namini is Lakshya\'s Associate Student Coordinator. She and Debajyoti  plan and organize Lakshya events in college and together with Shine, the student coordinator, are the faces of the organization on campus.\r\n\r\nNamini is a Computer Science and Engineering student from the Class of 2015.','https://www.facebook.com/namini.j.reddy','','',''),(23,'Rashid Khan','rashid','Web Developer','team_pics/rashid.jpg','Rashid has come on board as Lakshya\'s web developer and coder and started off with a complete redesign of the website. His amazing ability to grasp new technology with ease has helped us build immense capacity in a short span. His development pace is also setting new standards for us to follow.\r\n\r\nRashid is a Computer Science and Engineering student from the Class of 2015.','','','','');
