INSERT INTO `utils_lakshyatestimonial` VALUES (1,'NIT Warangal faculty talking about their experience with Lakshya','','<iframe src=\"//player.vimeo.com/video/83431474?title=0&amp;byline=0&amp;portrait=0\" width=\"274\" height=\"174\" frameborder=\"0\" webkitallowfullscreen mozallowfullscreen allowfullscreen></iframe>',307,'Faculty members at NIT Warangal','2014-01-07',1,1),(2,'\"Lakshya Scholarship helped me to a great extent by reducing the fianancial burden during my engineering. It was a good inspiration for me to achieve higher goals.\"','update_pics/g3.jpg','',6,'Scholarship Holder','2014-01-07',2,1),(3,'\"Transparent mode of selection and sharing financial information are key areas which satisfy. I look forward to many more donors coming forward to help the Foundation broaden their activities.\"\r\n','update_pics/naresh_ummat.jpg','',32,'Alumni Donor','2014-01-07',3,1),(4,'\"I remember the support extended by the Lakshya crew in all the processes right from the abstract submission to patent filings. Lakshya Foundation helped me achieve my dream.\"','update_pics/joby.jpg','',308,'Student Innovator','2014-01-07',4,1),(5,'Ravi Teja talks about the support extended by the Middle East Chapter alumni','','<iframe src=\"//player.vimeo.com/video/83431475?title=0&amp;byline=0&amp;portrait=0\" width=\"274\" height=\"174\" frameborder=\"0\" webkitallowfullscreen mozallowfullscreen allowfullscreen></iframe>',19,'Scholarship Holder','2014-01-07',5,1),(6,'\"Lakshya is very systematic and transparent, something that not only reassures the donor but also motivates more people to donate.\"','update_pics/ppuvvada.png','',113,'Alumni Donor from Atlanta, USA','2014-01-07',6,1);
