INSERT INTO `utils_lakshyaupdate` VALUES (1,'Mr.Venkat Changavalli (RECW 1970-1975) and Mr.Vasant Roy (RECW 1975-1980) join Lakshya\'s Board of Advisors','2012-09-20',6,0,'update_pics/vc_vr.jpg'),(2,'After the alumni poured in over Rs.50,000 on this beautiful machine through Lakshya, NITW has sanctioned funds to pay for the patent application - a first of its kind collaboration!','2012-08-13',9,0,'update_pics/hovomarine-final.jpg'),(3,'Lakshya and NITW signed an MoU to be equal stake holder in Lakshya\'s Innovation Projects.','2012-07-18',11,0,'update_pics/DSCN0034.JPG'),(4,'The following innovative ideas were selected for the Innovation Project 2012-2013. These ideas will be jointly funded by NIT Warangal and Lakshya:<br/>\r\n<br/>\r\n1. Ferro Fibre Tie Confined Self Compacting Concrete for Improving Earthquake Resistance<br/>\r\n2. Bond Characteristics of GFRP Bars in Recycled Aggregate Concrete<br/>\r\n3. Nano-Silica Inclusions for Strength and Durability of Self Compacting Concrete<br/>\r\n4. Cloudsgreen.com<br/>\r\n5. Advanced Speech Recognition System for Home Appliances<br/>\r\n<br/>','2012-09-12',8,0,'update_pics/event.jpg'),(5,'Lakshya sponsored innovation project abstract has been shortlisted for the 3rd international conference for Sustainable Construction Materials and Technologies SCMT3, Kyoto, Japan.','2012-08-13',10,0,''),(7,'Joby Yeldo shows his gratitude to his teachers and friends. His invention, the \'Hovomarine\', was mentioned by the Director in his convocation address.\r\n<p>Lakshya has initiated the patent application process for the Hovomarine - the first Lakshya sponsored innovation project. This is a first for NIT Warangal.</p>','2012-09-16',7,0,'update_pics/mentionInBrochure.jpg'),(8,'<p>Lakshya\'s first Board Meeting takes place on campus at NIT Warangal<br/>\r\n\r\nMore images can be found <a href = \"https://www.facebook.com/media/set/?set=a.484951344870812.121068.155497721149511&type=1\">here</a>\r\n\r\n</p>','2012-11-13',5,0,'update_pics/IMG_0337.jpg'),(9,'Lakshya conducted its second board meeting at NIT Warangal on Saturday 19th January 2013','2013-01-23',2,1,'update_pics/IMG_0781.JPG'),(10,'NITW B.Tech Mech students qualify for the Baja SAE final event to be held near Indore (MP). They are building the all terrain vehicle from scratch. Funds and technical guidance have come in from alumni through Lakshya to give Team Motoholics that extra punch.','2013-01-21',3,1,'update_pics/2013-01-26_16.03.06.jpg'),(11,'Patent application for Lakshya sponsored project, Hovomarine, filed on 26/11/2012 in the name of NIT Warangal.\r\n\r\nOne small step for the institute, one giant leap for the NITW community.','2013-01-04',4,1,'update_pics/600383_504454509587162_516858499_n.jpg'),(12,'Lakshya is funding development of speech controlled device by sophomore students at NIT Warangal. This consists of hardware and software which helps users control (for now) electrical devices through speech.\r\n\r\n<iframe width=\"420\" height=\"315\" src=\"http://www.youtube.com/embed/kfdCJrWudoU\" frameborder=\"0\" allowfullscreen></iframe>','2013-01-29',1,1,''),(14,'Lakshya organized a limited-gathering alumni meet in Hyderabad at Avasa Hotel on 30th March 2013 to discuss ways to give back to NIT Warangal. Please visit our <a href=https://www.facebook.com/media/set/?set=a.566801203352492.1073741825.155497721149511&type=1>facebook page</a> for more images of the meet.','2013-03-30',1,0,'update_pics/pic.jpg'),(15,'Lakshya conducted its third board meeting in Hyderabad, Golf club.','2013-04-20',5,1,''),(16,'Two new projects -Hybridized three wheeler and Mapping Genomic Systems are selected under Innovation Support Program 2013-14. ','2013-04-09',6,1,''),(17,'Media Coverage of Lakshya','2013-04-14',5,1,'update_pics/media_coverage.jpg'),(18,'As a part of expansion Lakshya recruited three members into the team\r\n\r\nI.V.Naveen (Working full time as a partner )\r\n\r\nGinu George ( Intern- Design )\r\n\r\nRashid Khan (Intern - Web development )','2013-05-20',5,1,''),(19,'New office spaces for Lakshya in Madhapur, Hyderabad and NIT Warangal','2013-06-03',5,1,'update_pics/Office_space.jpg'),(20,'Launch of Lakshya\'s new Website','2013-06-30',5,1,'update_pics/New_website.jpg'),(21,'Three new students of 2012-16 batch are being funded by Lakshya under Financial Assistance Program.','2013-06-04',5,1,''),(22,'RISE Lecture series has been launched with Mr.Venkat Changavalli.','2013-08-10',5,1,'update_pics/Rise-2.jpg'),(23,'Lakshya conducted its fourth board meeting in NIT Warangal campus. ','2013-08-10',5,1,'update_pics/BM4-2.jpg'),(24,'Lakshya hosted the first NITW Entrepreneur Meet on September 29th in Hyderabad which went off amazingly well. Students were super excited to meet the alumni and keynote speakers and interact with them.\r\n','2013-09-29',7,1,'update_pics/NEM_album_cover_pic.jpg');
